import {OrganizationIcon, PeopleIcon, PulseIcon} from '@primer/octicons-react';

export const Delta7Icon = () => (
  <div className="Icons">
    <PulseIcon size={16} />
    <span>7D</span>
  </div>
);

export const PerLakhIcon = () => (
  <div className="Icons">
    <PeopleIcon size={16} />
    <span>1L</span>
  </div>
);

export const DistrictIcon = () => (
  <div className="Icons">
    <OrganizationIcon size={16} />
  </div>
);
